const Index = () => (
  <div>
    <div className="content">
        <div className="page-title">
            <h1 className="title">Articles</h1>
            <hr/>
          </div>
          <ul>
            {this.renderArticleList()}
          </ul>
        </div>
  </div>
);
export default Index;
